package Day15;

public class Member {

	private String name;
	private int num;
	
	
	public Member(String name, int num) {
		
		this.name = name;
		this.num = num;
	}
	
	public Member() {
		// TODO Auto-generated constructor stub
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public int getNum() {
		return num;
	}

	public void setNum(int num) {
		this.num = num;
	}
	
	
	
}
